   "source": [
    "# Bellabeat data analysis using R\n",
    "### Scenario\n",
    "Bellabeat is a manufacturer of high-tech products focused on people's health. It's a successful small company but has the potential to become a bigger player in the global market of smart devices. Analyzing physical activity data from smart devices is believed to unveil new business opportunities for the company.\n",
    "### Objective\n",
    "Understand how people are using their smart devices. Then, with this information, provide high-level recommendations on how these trends can contribute to Bellabeat's marketing strategy."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "1272ae5f",
   "metadata": {
    "papermill": {
     "duration": 0.021389,
     "end_time": "2024-03-17T21:27:46.408481",
     "exception": false,
     "start_time": "2024-03-17T21:27:46.387092",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "## Ask\n",
    "* What are some usage trends of smart devices?\n",
    "* How could these trends be applied to Bellabeat's customers?\n",
    "* How might these trends help influence Bellabeat's marketing strategy?\n",
    "* Who are the users of smart devices? Are there specific user segments based on age, gender, geographic location, or lifestyle that are more inclined to use these devices?"
   ]
  },
